import axios from 'axios';
import { Variable } from 'components'

const DETAILBUKU_API_URL = `${API_URL}/buku/detail/`;

class ComponentService {
	detailBuku(bukuId) {
		return axios.post(`${DETAILBUKU_API_URL}` + bukuId)
	}
}

export default new ComponentService()
